// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./AddressReg.sol";
import "./registry.sol";
import "./IERC20.sol";

contract DailyTokenDistribution {
    uint256 public totalSupply;      // Total token pool
    uint256 public dailyMax;         // Max tokens that can be distributed daily
    uint256 public distributedToday; // Track the distributed amount for the current day
    uint256 public currentDay;       // Track the current day for daily distribution reset
    address xusd;
    using LibRegistryAdd for LibRegistryAdd.Registry;
        using LibRegistry for LibRegistry.Registry;
    // Custom Errors
    mapping(address => mapping(uint => uint)) public lpRewards; // Track user balances

    mapping(address => bool) public lpList;

    address public owner; // Owner of the contract

    struct UsersGains {

        LibRegistry.Registry UserGains;
        mapping(uint=> uint256)  userBalances;
    }
  LibRegistryAdd.Registry LpRepo;
    //  users   ----- >>>   Lp Address ----->> registry of days corresponding to then the amounts
  mapping(address => mapping(address => UsersGains)) internal userBalances;


    // Event for token withdrawal
    event Withdraw(address indexed user, uint256 amount);
    // Event for token distribution
    event DistributeTokens(address indexed user, uint256 amount);

    // Modifier to allow only the owner to call certain functions
    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    // Modifier to reset the daily distribution if a new day starts
    modifier resetIfNewDay() {
        uint256 today = block.timestamp / 1 days;
        if (today > currentDay) {
            distributedToday = 0; // Reset daily distribution
            currentDay = today;   // Update to the new day
        }
        _;
    }

    // Contract deployer sets the total token supply and daily max on creation
    constructor( uint256 _dailyMax, address _xusd) {
        xusd = _xusd;

        dailyMax = _dailyMax;
        currentDay = block.timestamp / 1 days;  // Initialize to the current day
        owner = msg.sender; // Set contract owner
    }


    function depositRewards(uint amount)external onlyOwner{
        IERC20(xusd).transferFrom(msg.sender, address(this), amount);
        totalSupply = IERC20(xusd).balanceOf(address(this));
    }


    function addLp(address lpAddress) external onlyOwner{
        require(!LpRepo.Contains(lpAddress), 'Lp Alrerady Added');

        LpRepo.Register(lpAddress);
        lpList[lpAddress] = true;


    }

    // Function to distribute tokens to a single user
    function distributeTokens(address user, uint256 amount, address lpAddress, uint period) external onlyOwner resetIfNewDay {
        require( lpRewards[lpAddress][period] <= dailyMax, "Exceeds daily max");
        require( lpList[lpAddress], "Lp Not on list");
        require(totalSupply >= amount, "Not enough tokens left in total supply");
        userBalances[user][lpAddress].UserGains.Register(period);
        userBalances[user][lpAddress].userBalances[period] = amount;

        lpRewards[lpAddress][period] += amount;

        totalSupply -= amount;

        emit DistributeTokens(user, amount); // Emit distribution event
    }

    // Batch update function: distribute tokens to multiple users at once
    function batchDistributeTokens(address[] calldata users, uint256[] calldata amounts, address lpAddress, uint period) external onlyOwner resetIfNewDay {
        require(users.length == amounts.length, "Users and amounts length mismatch");
require( lpList[lpAddress], "Lp Not on list");


        // Calculate total tokens to be distributed in the batch
        for (uint256 i = 0; i < users.length; i++) {

             userBalances[users[i]][lpAddress].UserGains.Register(period);
        userBalances[users[i]][lpAddress].userBalances[period] = amounts[i];

        lpRewards[lpAddress][period] += amounts[i];

        totalSupply -= amounts[i];

        }


    }

    // Function for users to withdraw tokens from their balance
    function withdraw() external {

        uint rewardsAmount = 0;


  // Calculate total tokens to be distributed in the batch
        for (uint256 i = 0; i < LpRepo.Count(); i++) {
             for (uint256 j = 0; j < userBalances[msg.sender][LpRepo.GetHashByIndex(i)].UserGains.Count(); j++) {
         rewardsAmount += userBalances[msg.sender][LpRepo.GetHashByIndex(i)].userBalances[userBalances[msg.sender][LpRepo.GetHashByIndex(i)].UserGains.GetHashByIndex(j)];

           userBalances[msg.sender][LpRepo.GetHashByIndex(i)].userBalances[userBalances[msg.sender][LpRepo.GetHashByIndex(i)].UserGains.GetHashByIndex(j)] = 0;
        }
        }

        IERC20(xusd).transfer(msg.sender, rewardsAmount);
        emit Withdraw(msg.sender, rewardsAmount);



    }

    // Function to check remaining tokens for distribution today
    function getRemainingDailyTokens() external view returns (uint256) {
        return dailyMax - distributedToday;
    }

    // Function to check user's balance
    function getUserBalance(address lpAddress, uint period) external view returns (uint256) {
        return userBalances[msg.sender][lpAddress].userBalances[period];
    }

    // Function to deposit Ether for use in the withdraw function (if using native tokens like ETH)
    receive() external payable {}
}

